class WellbeingQuestionDto {
  WellbeingQuestionDto({
      List<QuestionDto>? data,
      num? perPage, 
      num? page, 
      num? totalPages,}){
    _data = data;
    _perPage = perPage;
    _page = page;
    _totalPages = totalPages;
}

  WellbeingQuestionDto.fromJson(dynamic json) {
    if (json['data'] != null) {
      _data = [];
      json['data'].forEach((v) {
        _data?.add(QuestionDto.fromJson(v));
      });
    }
    _perPage = json['perPage'];
    _page = json['page'];
    _totalPages = json['totalPages'];
  }
  List<QuestionDto>? _data;
  num? _perPage;
  num? _page;
  num? _totalPages;
WellbeingQuestionDto copyWith({  List<QuestionDto>? data,
  num? perPage,
  num? page,
  num? totalPages,
}) => WellbeingQuestionDto(  data: questionDto ?? _data,
  perPage: perPage ?? _perPage,
  page: page ?? _page,
  totalPages: totalPages ?? _totalPages,
);
  List<QuestionDto>? get questionDto => _data;
  num? get perPage => _perPage;
  num? get page => _page;
  num? get totalPages => _totalPages;

  Map<String, dynamic> toJson() {
    final map = <String, dynamic>{};
    if (_data != null) {
      map['QuestionDto'] = _data?.map((v) => v.toJson()).toList();
